//App.js

import React from "react";
import "./App.css";
import Box from "./Box";

function App() {
  return (
    <>
      <Box name="은서" />
      <Box name="승민" />
      <Box name="상현" />
      <Box name="민석" />
    </>
  );
}

export default App;
